import React from 'react';
import './Titlecard.css'

function Titlecard () {
    return (
        <a href = "about">
            <div className = "header-container">
                <h2>
                    <span className="inline-block">I'm a developer and business practicioner who believes</span>
                    <span className="inline-block">that<span> bridging differences</span> unlocks opportunities</span>
                </h2>
            </div>
        </a>
    );
}

export default Titlecard
